const INPUT_TEXT_SURNAME='INPUT_TEXT_SURNAME';//Фамилия
const INPUT_TEXT_NAME='INPUT_TEXT_NAME';//Имя
const INPUT_TEXT_MIDDLE_NAME='INPUT_TEXT_MIDDLE_NAME';//Отчество
const INPUT_TEXT_PHONE='INPUT_TEXT_PHONE';//Телефон
const INPUT_TEXT_EMAIL='INPUT_TEXT_EMAIL';//Емаил
const INPUT_TEXT_PASSWORD='INPUT_TEXT_PASSWORD';//Пароль

const initialState = {
    surname:'',
    name:'',
    middleName:'',
    phone:'',
    mail:'',
    password:''
};
const RegistrationReducer=( state =initialState,action)=>{
    switch (action.type) {
        case INPUT_TEXT_SURNAME:
            return{
                ...state,
                surname: action.bodySurname
            };
        case INPUT_TEXT_NAME:
            return{
                ...state,
                surname: action.bodyName
            };
        case INPUT_TEXT_MIDDLE_NAME:
            return{
                ...state,
                surname: action.bodyMiddleName
            };
        case INPUT_TEXT_PHONE:
            return{
                ...state,
                surname: action.bodyPhone
            };
        case INPUT_TEXT_EMAIL:
            return{
                ...state,
                surname: action.bodyEmail
            };
        case INPUT_TEXT_PASSWORD:
            return{
                ...state,
                surname: action.bodyPassword
            }
        default:
                return {...state}
    }
};
export const updateTextSurname = (surname) =>({type:INPUT_TEXT_SURNAME, bodySurname:surname});
export const updateTextName = (name) =>({type:INPUT_TEXT_NAME, bodySurname:name});
export const updateTextMiddleName = (middleName) =>({type:INPUT_TEXT_MIDDLE_NAME, bodySurname:middleName});
export const updateTextPhone = (phone) =>({type:INPUT_TEXT_PHONE, bodySurname:phone});
export const updateTextEmail = (email) =>({type:INPUT_TEXT_EMAIL, bodySurname:email});
export const updateTextPassword = (password) =>({type:INPUT_TEXT_PASSWORD, bodySurname:password});
export default RegistrationReducer;
